// Header.js

import React from "react";
import { AppBar, Toolbar, Typography, Button } from "@mui/material";
import Slides from "./Home/Slides";
const Header = ({ onButtonClick }) => {
  return (
    <AppBar position="fixed" color="transparent" elevation={0}>
      <Toolbar>
        <Typography variant="h5" sx={{ flexGrow: 1, textDecoration: 'none', color: 'inherit' }}>
          PORTFOLIO
        </Typography>
        <Button color="inherit" onClick={() => Slides.onButtonClick(0)}>
          Projects
        </Button>
        <Button color="inherit" onClick={() => onButtonClick(1)}>
          Resume
        </Button>
        <Button color="inherit" onClick={() => onButtonClick(2)}>
          Skills
        </Button>
        <Button color="inherit" onClick={() => onButtonClick(3)}>
          Contact
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
